import React from "react";
import Revolve from "../../Assets/Revolve.png";

const MidSetion = () => {
  return (
    <div className=" pt-4 items-center justify-center flex ">
      <img src={Revolve} alt="Revolve" />
    </div>
  );
};

export default MidSetion;
